(141, 'Cloud Integration', '<p>Smoothly transition to cloud platforms while integrating secure <strong>Office 365, Microsoft Teams, and SharePoint</strong> to enhance collaboration, automate workflows, and optimize document management. Unlock the full potential of your digital workplace with <strong>AI-driven insights</strong> and automation, fostering smarter collaboration and decision-making across your organization.</p>', '2024-09-10', NULL, NULL, NULL, NULL, NULL, NULL, 'fa-cloud-upload', 1, 4, 2, 0, 6, NULL, NULL, NULL, 'Cloud Migration & Office 365 Integration', '', NULL, 'cloud-migration-&-office-365-integration', 1, 1, '2024-09-10 15:18:07', '2024-09-11 12:32:29', 'Skyplattformer Integrasjoner', '<p>Sørg for en smidig overgang til skyplattformer ved å integrere sikker <strong>Office 365, Microsoft Teams og SharePoint</strong> for å forbedre samarbeid, automatisere arbeidsflyter og optimalisere dokumenthåndtering. Lås opp det fulle potensialet i din digitale arbeidsplass med <strong>AI-drevne</strong> innsikter og automasjon, som fremmer smartere samarbeid og beslutningstaking på tvers av organisasjonen din.</p>', 'Cloud Migration & Office 365 Integration', '', NULL, 'cloud-migration-&-office-365-integration'),
(142, 'SharePoint Development', '<p>Unlock the full potential of <strong>SharePoint</strong> with solutions that automate workflows, optimize document management, and foster collaboration across your organization.</p>', '2024-09-10', NULL, NULL, NULL, NULL, NULL, NULL, 'fa-share-alt-square', 1, 0, 2, 0, 7, NULL, NULL, NULL, 'SharePoint Development', '', NULL, 'sharepoint-development', 1, 1, '2024-09-10 15:21:15', '2024-09-10 15:21:48', 'Sharepoint utvikling', NULL, 'Sharepoint utvikling', '', NULL, 'sharepoint-utvikling'),
(143, 'Consultancy Services', '<p>From initial concept to deployment, our software <strong>consultancy</strong> services guide you through the entire <strong>development lifecycle</strong>, ensuring you make the best technology decisions for long-term success. We have experienced consultants with <strong>frontend, backend and fullstack</strong> experience.</p>', '2024-09-10', NULL, NULL, NULL, NULL, NULL, NULL, 'fa-superpowers', 1, 2, 2, 0, 8, NULL, NULL, NULL, 'Consultancy Services', '', NULL, 'consultancy-services', 1, 1, '2024-09-10 16:08:57', '2024-09-11 12:33:39', 'Konsulenttjenester', '<p>Fra første konsept til implementering veileder våre programvaretjenester deg gjennom hele utviklingssyklusen, og sikrer at du tar de beste teknologivalgene for langsiktig suksess. Vi har erfarne konsulenter med <strong>frontend-, backend- og fullstack-erfaring</strong>.</p>', 'Konsulenttjenester', '', NULL, 'konsulenttjenester'),
(144, 'AI & Automation', '<p>Smoothly transition to cloud platforms while integrating secure <strong>Office 365, Microsoft Teams, and SharePoint</strong> to enhance collaboration, automate workflows, and optimize document management. Unlock the full potential of your digital workplace with <strong>AI-driven insights</strong> and automation, fostering smarter collaboration and decision-making across your organization.</p>', '2024-09-10', NULL, NULL, NULL, NULL, NULL, NULL, 'fa-angellist', 1, 3, 2, 0, 6, NULL, NULL, NULL, 'Cloud Migration & Office 365 Integration - Copy', '', NULL, 'cloud-integration', 1, 1, '2024-09-10 17:15:44', '2024-09-11 12:35:00', 'AI & Automation', '<p>Sørg for en smidig overgang til skyplattformer ved å integrere sikker <strong>Office 365, Microsoft Teams og SharePoint</strong> for å forbedre samarbeid, automatisere arbeidsflyter og optimalisere dokumenthåndtering. Lås opp det fulle potensialet i din digitale arbeidsplass med <strong>AI-drevne</strong> innsikter og automasjon, som fremmer smartere samarbeid og beslutningstaking på tvers av organisasjonen din.</p>', 'Cloud Migration & Office 365 Integration - Copy', '', NULL, 'skyplattformer-integrasjoner'),
